Description
Ally Style, Bailey Brookes, Devon Lee, Isis Taylor, Jackie Lin, Lyla Storm

Derek visits the local massage parlor and to his surprise he finds out that his wife's twin sister is working there as a massage therapist. During the massage his sister in law decides to give him an extra treatment, something that his wife would never do. Derek rejects the idea at first but gives up once Devon starts stroking his cock. Stay tuned for a surprising ending! And other stories... Enjoy!
